import { useRouter } from "next/router";

import { useAuth } from "../components/hooks/useAuth";
import { withApollo } from "../components/hooks/withApolloHook";
import Content from "../components/general/profile/home/Home";
import Nav from "../components/Nav"
import styles from "../css/profile/home/content.module.css";
import { useEffect } from "react";

interface MeData {
    me: {
        id: string;
        username: string;
        email: string;
        avatar: string;
    }
}

export const Home = () => {
    const router = useRouter();
    const me: MeData = useAuth();
    console.log(me.me)
    // if(!me && process.browser) router.push('/'); 

    return (
        <>
            <title>Home</title>
            <div className={styles.content}>
                <Content/>
                <Nav/>
            </div>
        </>
    )
}

export default withApollo(Home);
